import { useEffect,useState } from "react"
import { fetchNews } from "../api_s/fetchNews"
import Navbar from "./Navbar"

function News(){
    const [err,setErr]=useState(null)
    const [data,setData]=useState(null)

    useEffect(()=>{
        fetchNews().then(data=>{
            if(data.feed){
                setData(data)
            }
            else{
                throw new Error(data.message)
            }
        }).catch(error=>{
            setErr(error)
            console.error(error)
        })
    },[])
    return(
        <>
            <Navbar/>
            
        </>
    )
}
export default News
